import httpClient from "@/utils/httpclient";
import succ from "@/components/registStatus";
export default {
  name: "registerCheckSuccess",
  components: {
    succ: succ
  },
  data: function data() {
    return {
      succInfo: "",
      errInfo: "",
      btnGroup: {
        btnFirst: "login"
      },
      status: ''
    };
  },
  mounted: function mounted() {
    var _this = this;

    httpClient.post("/api/v1/email/verification", {
      token: this.$route.query.token
    }).then(function (response) {
      if (response.data.data && response.data.data == "ok") {
        _this.succInfo = "Registration Complete!";
        _this.status = 1;
      } else {
        _this.errInfo = "Sorry, the verification link has been used or has expired.";
        _this.status = 2;
      }
    }).then(function (err) {
      _this.errInfo = "Sorry, the verification link has been used or has expired.";
      _this.status = 2;
    });
  }
};
